// client/src/routes/AppRoutes.js

import React from 'react';
import { Routes, Route } from 'react-router-dom';


import RegisterPage from '../pages/RegisterPage';
import LoginPage from '../pages/LoginPage';

// Admin
import AdminRoute from './AdminRoute';
import AdminDashboardPage from '../pages/admin/AdminDashboardPage';

// --- IMPORT THE NEW ADMIN PRODUCT PAGES ---
import ProductListPage from '../pages/admin/products/ProductListPage';
import AddProductPage from '../pages/admin/products/AddProductPage';
import EditProductPage from '../pages/admin/products/EditProductPage';


const AppRoutes = () => {
    return (
        <Routes>
            {/* Public Routes */}
            <Route path="/" element={<HomePage />} />
            <Route path="/register" element={<RegisterPage />} />
            <Route path="/login" element={<LoginPage />} />

            {/* Admin Protected Routes */}
            <Route path="/admin" element={<AdminRoute />}>
                <Route index element={<AdminDashboardPage />} />
                {/* --- ADD THE NEW PRODUCT ROUTES HERE --- */}
                <Route path="products" element={<ProductListPage />} />
                <Route path="products/add" element={<AddProductPage />} />
                <Route path="products/edit/:id" element={<EditProductPage />} />
            </Route>

            {/* Add more routes here: products, cart, profile, etc. */}
        </Routes>
    );
};

export default AppRoutes;
